import React from "react";
import ReactDOM from "react-dom";
import Joke from "./Joke";

function App() {
  return (
    <div className="App">
      <Joke
        question="Why Did The Chicken Cross The Road?"
        answer="To Get The Other Side"/>

      <Joke
        question="I'm not no goofy."
        answer="Never been a goofy, man."/>

      <Joke
        answer="Don't you hate it when like, you take a bite out of an avocado and it's still a little hard. 
        so you unload a full clip into the nearest ambulance."/>

    </div>
  );
}

export default App;
